function CreateItem(){

    const FormTemplate = (label, name) => {
        return(
        <TextField 
        required
        variant="outlined"
        id="outline-required"
        label= {label}
        name= {name}
        onChange={e=>console.log(e.target.value)}
      ></TextField>
        )
    }

    const [age, setAge] = useState("")

    const handleChange = (e) => {
      setAge(e.target.value);
    };

    console.log(age)

    const SelectTemplate = (label, name) => {
        return(
            <Select
            required
            variant="outlined"
            id="outline-required"
            label= {label}
            name= {name}
            // defaultValue={"Age"}
            onChange={e=>setAge(e.target.value)}
            >
              <ListGroupItem value={10}>Ten</ListGroupItem>
              <ListGroupItem value={20}>Twenty</ListGroupItem>
              <ListGroupItem value={30}>Thirty</ListGroupItem>
            </Select>
        )
    }



    return(
        <div>
            <h1>CreateItem</h1>


        <Form>
            {FormTemplate("Name", "name")}
            {FormTemplate("Expiration Date", "exp_date")}
            {FormTemplate("Storage Type", "storage")}
            {SelectTemplate("1")}

        </Form>



        </div>
    )
}
export default CreateItem
